(3823, 136, 'http://localhost:8080/L-essential-dev/Data_Center/index.php/blog/Draft/postdatahttp://localhost:8080/L-essential-dev/Data_Center/index.php/blog/Draft/postdata/update', '{\"id_article\":\"3\",\"actiondata\":\"update\",\"dynamicpost\":\"Y\",\"checkdata1\":\"slug_article\",\"checkdata2\":\"\",\"checkdata3\":\"\",\"checkdata4\":\"\",\"dengangambar\":\"N\",\"status_article\":\"3\",\"article\":\"<h3 style=\\\"font-family: Montserrat; font-weight: 700; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 18px; text-align: justify;\\\">Konfigurasi Dasar Codeigniter<\\/h3><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px; text-align: justify;\\\">silahkan buka file config\\/config.php yang ada dalam folder application dan seeting base_url sebagai berikut :<\\/p><pre class=\\\"lang:default decode:true\\\" style=\\\"font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 30px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;\\\">$config[\'base_url\']\\t= \'http:\\/\\/localhost\\/absensi\\/\';<\\/pre><h3 style=\\\"font-family: Montserrat; font-weight: 700; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 18px;\\\">Membuat Form Multiple Upload<\\/h3><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px; text-align: justify;\\\">langkah pertama adalah membuat form upload yang akan digunakan sebagai interface untuk mengupload file. silahkan buat sebuah controller dengan nama Upload dan buat sebuah function index yang akan nantinya akan memanggil view form upload yang ada pada folder view, script nya adalah sebagai berikut :<\\/p><pre class=\\\"lang:php decode:true \\\" style=\\\"font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 30px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;\\\">&lt;?php\\r\\nclass upload extends CI_Controller{\\r\\n    \\r\\n    function __construct() {\\r\\n        parent::__construct();\\r\\n        $this-&gt;load-&gt;helper(array(\'form\'));\\r\\n    }\\r\\n    \\r\\n    function index(){\\r\\n        $this-&gt;load-&gt;view(\'form_upload\');\\r\\n    }\\r\\n}<\\/pre><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px; text-align: justify;\\\">lalu buatlah sebuah file baru dengan &nbsp;nama file form_upload.php didalam folder view, lalu tulislah script berikut untuk membuat form interface upload yang akan ditampilkan pada halaman mengguna :<\\/p><pre class=\\\"lang:default decode:true\\\" style=\\\"font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 30px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;\\\">&lt;!DOCTYPE html&gt;\\r\\n&lt;html&gt;\\r\\n    &lt;head&gt;\\r\\n        &lt;title&gt;Multiple Upload File Codeigniter&lt;\\/title&gt;\\r\\n    &lt;\\/head&gt;\\r\\n    &lt;body&gt;\\r\\n        &lt;h3&gt;Multiple Upload File Codeigniter&lt;\\/h3&gt;\\r\\n        &lt;?php echo form_open_multipart(\'upload\\/multiple_upload\'); ?&gt;\\r\\n        &lt;table border=\\\"1\\\"&gt;\\r\\n            &lt;tr&gt;&lt;td&gt;File 1&lt;\\/td&gt;&lt;td&gt;&lt;?php echo form_upload(\'file1\'); ?&gt;&lt;\\/td&gt;&lt;\\/tr&gt;\\r\\n            &lt;tr&gt;&lt;td&gt;File 2&lt;\\/td&gt;&lt;td&gt;&lt;?php echo form_upload(\'file2\'); ?&gt;&lt;\\/td&gt;&lt;\\/tr&gt;\\r\\n            &lt;tr&gt;&lt;td&gt;&lt;\\/td&gt;&lt;td&gt;&lt;?php echo form_submit(\'upload\', \'upload file\'); ?&gt;&lt;\\/td&gt;&lt;\\/tr&gt;\\r\\n        &lt;\\/table&gt;\\r\\n        &lt;?php echo form_close() ?&gt;\\r\\n    &lt;\\/body&gt;\\r\\n&lt;\\/html&gt;<\\/pre><h3 style=\\\"font-family: Montserrat; font-weight: 700; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 18px;\\\">Membuat Proses Multiple Upload<\\/h3><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px; text-align: justify;\\\">langkah selanjutnya kita akan membuat sebuah function baru dengan nama multiple_upload pada controller upload, fungsi dari function ini adalah untuk memproses file yang akan di upload ke server, jadi sekarang script controller nya menjadi seperti ini :<\\/p><pre class=\\\"lang:php decode:true \\\" style=\\\"font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px; padding: 9.5px; margin-bottom: 30px; line-height: 1.42857; color: rgb(51, 51, 51); word-break: break-all; overflow-wrap: break-word; background-color: rgb(245, 245, 245); border: 1px solid rgb(204, 204, 204); border-radius: 4px;\\\">&lt;?php\\r\\nclass upload extends CI_Controller{\\r\\n    \\r\\n    function __construct() {\\r\\n        parent::__construct();\\r\\n        $this-&gt;load-&gt;helper(array(\'form\'));\\r\\n    }\\r\\n    \\r\\n    function index(){\\r\\n        $this-&gt;load-&gt;view(\'form_upload\');\\r\\n    }\\r\\n    \\r\\n    function multiple_upload(){\\r\\n         $config[\'upload_path\']   = \'.\\/uploads\\/\'; \\r\\n         \\/\\/$config[\'allowed_types\'] = \'gif|jpg|png\'; \\r\\n         \\/\\/$config[\'max_size\']      = 100; \\r\\n         \\/\\/$config[\'max_width\']     = 1024; \\r\\n         \\/\\/$config[\'max_height\']    = 768;  \\r\\n         $this-&gt;load-&gt;library(\'upload\', $config);\\r\\n         \\/\\/ script upload file pertama\\r\\n         $this-&gt;upload-&gt;do_upload(\'file1\');\\r\\n         $file1 = $this-&gt;upload-&gt;data();\\r\\n         echo \\\"&lt;pre&gt;\\\";\\r\\n         print_r($file1);\\r\\n         echo \\\"&lt;\\/pre&gt;\\\";\\r\\n         \\r\\n         \\/\\/ script uplaod file kedua\\r\\n         $this-&gt;upload-&gt;do_upload(\'file2\');\\r\\n         $file2 = $this-&gt;upload-&gt;data();\\r\\n         echo \\\"&lt;pre&gt;\\\";\\r\\n         print_r($file2);\\r\\n         echo \\\"&lt;\\/pre&gt;\\\";\\r\\n    }\\r\\n}<\\/pre><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px;\\\">&nbsp;<\\/p><h3 style=\\\"font-family: Montserrat; font-weight: 700; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 18px;\\\">Melakukan Percobaan Upload File<\\/h3><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px; text-align: justify;\\\">sekarang silahkan masukan&nbsp;http:\\/\\/localhost\\/absensi\\/upload pada web browser kesayangan anda maka akan tampil form seperti berikut :<br><a href=\\\"https:\\/\\/belajarphp.net\\/wp-content\\/uploads\\/2016\\/09\\/form_multiple_upload_file.png\\\" rel=\\\"attachment wp-att-2530\\\" style=\\\"color: rgb(72, 167, 212); transition: all 0.25s ease 0s; outline: 0px !important;\\\"><img class=\\\"alignnone size-large wp-image-2530\\\" src=\\\"https:\\/\\/belajarphp.net\\/wp-content\\/uploads\\/2016\\/09\\/form_multiple_upload_file.png\\\" alt=\\\"form_multiple_upload_file\\\" width=\\\"468\\\" height=\\\"296\\\" style=\\\"border: 0px; max-width: 100%; height: auto; margin: 5px 20px 20px 0px;\\\"><\\/a><\\/p><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px;\\\">silahkan pilih kedua file yang akan di upload dan klik button upload file maka akan muncul informasi tentang file yang anda upload sebagai berikut :<\\/p><p style=\\\"margin-right: 0px; margin-bottom: 30px; margin-left: 0px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;; font-size: 14px;\\\"><font color=\\\"#48a7d4\\\"><span style=\\\"transition-duration: 0.25s; transition-property: all; outline-color: initial !important; outline-style: initial !important; border-style: initial; border-color: initial; border-image: initial; height: auto;\\\"><img class=\\\"alignnone size-full wp-image-2529\\\" src=\\\"https:\\/\\/belajarphp.net\\/wp-content\\/uploads\\/2016\\/09\\/codeigniter_multiple_upload_file_result.png\\\" alt=\\\"codeigniter_multiple_upload_file_result\\\" width=\\\"693\\\" height=\\\"672\\\" style=\\\"border: 0px; max-width: 100%; height: auto; margin: 5px 20px 20px 0px;\\\"><\\/span><\\/font><\\/p>\"}', '::1', 'Chrome', 'Windows 10 - SYSTEM', '2020-05-04 07:42:23'),
