(4002, 1, 'http://localhost:8080/L-essential-dev/Data_Center/index.php/blog/Draft/postdatahttp://localhost:8080/L-essential-dev/Data_Center/index.php/blog/Draft/postdata/update', '{\"id_article\":\"1\",\"actiondata\":\"update\",\"dynamicpost\":\"Y\",\"checkdata1\":\"slug_article\",\"checkdata2\":\"\",\"checkdata3\":\"\",\"checkdata4\":\"\",\"dengangambar\":\"N\",\"status_article\":\"1\",\"article\":\"<h1 style=\\\"outline: 0px; font-size: 36px; margin: 20px 0px 10px; font-family: OpenSansRegular, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51);\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Berkenalan dengan CodeIgniter<br style=\\\"outline: 0px;\\\"><\\/span><\\/h1><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Akhir-akhir ini CodeIgniter menjadi sebuah&nbsp;<em style=\\\"outline: 0px;\\\">framework&nbsp;<\\/em>yang paling banyak dibicarakan di Indonesia. Bahkan banyak forum PHP dan milis yang membicarakan tentang&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;satu ini. Terlebih lagi banyak perusahaan besar dan terkenal di Indonesia menggunakan framework CodeIgniter dalam memasarkan produk yang mereka keluarkan, contohnya seperti Okezone.com, Urbanesia.com,&nbsp; Kompas.com, dan lain-lain. CodeIgniter sendiri adalah seuah&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;PHP yang dapat mempercepat pengembangan untuk membuat sebuah aplikasi web, selain itu banyak&nbsp;<em style=\\\"outline: 0px;\\\">library<\\/em>&nbsp;dan&nbsp;<em style=\\\"outline: 0px;\\\">helper<\\/em>&nbsp;yang berguna di dalamnya dan tentu saja membantu dalam proses pembangunan web yang kita buat. Contohnya jika ingin membangun rumah idaman anda, anda tidak perlu membuat besi, memotong kayu menjadi papan, dan lain-lain, tetapi anda hanya cukup memilih komponen yang ingin anda buat tersebut di toko bangunan. Dalam hal ini toko bangunan adalah&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Setelah mengerti tentang&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>, maka kita lanjutkan lagi dengan keuntungan menggunakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>. Menurut saya, keuntungan menggunakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;adalah :<\\/p><ol style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Reuse of code<\\/span>&nbsp;: Artinya dengan menggunakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;maka pekerjaan kita memiliki struktur yang baku, sehingga dapat digunakan kembali di projek berikutnya.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Menghemat waktu<\\/span>&nbsp;: Karena dengan adanya struktur dan&nbsp;&nbsp;<em style=\\\"outline: 0px;\\\">library<\\/em>&nbsp;yang telah di sediakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;maka tidak perlu lagi memikirkan hal-hal tersebut. Jadi kita hanya fokus ke proses bisnis yang kita kerjakan.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Banyak Komunitas<\\/span>&nbsp;: bantuan dari para sesepuh codeigniter siap membantu kita dalam pengerjaan projek yang kita buat.<\\/li><\\/ol><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sebelum memahami CodeIgniter lebih jauh, sebaiknya di pahami terlebih dahulu tentang&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>, Nah kalau bahasa google yang saya cari arti dari Framework adalah sebuah struktur konseptual dasar yang digunakan untuk memecahkan sebuah permasalahan atau isu-isu kompleks. Perlu anda ingat bahawa, framework bukanlah tools untuk memecahkan suatu masalah, tetapi sebagai alat bantu.<\\/p><h2 style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 5px; font-size: 30px;\\\"><span style=\\\"outline: 0px;\\\">Alasan menggunakan Framework ?<\\/span><\\/h2><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salah satu alasan mengapa orang menggunakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;terutama dalam membangun sebuah aplikasi adalah kemudahan yang ditawarkan. Di dalam sebuah&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;biasanya sudah tersedia struktur aplikasi yang baik, standard coding,&nbsp;<em style=\\\"outline: 0px;\\\">best practice<\\/em>,&nbsp;<em style=\\\"outline: 0px;\\\">design pattern<\\/em>&nbsp;dan&nbsp;<em style=\\\"outline: 0px;\\\">common function<\\/em>. Dengan menggunakan framework kita dapat langsung fokus kepada business process yang dihadapi tanpa harus berfikir banyak masalah &nbsp;struktur aplikasi, standar coding dan lain-lain. &nbsp;<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Dengan memanfaatkan&nbsp;<em style=\\\"outline: 0px;\\\">design pattern<\\/em>&nbsp;dan&nbsp;<em style=\\\"outline: 0px;\\\">common function<\\/em>&nbsp;yang telah ada di dalam&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;maka hal tersebut dapat mempercepat proses pengembangan aplikasi. Kita tidak perlu membuat sesuatu fungsionalitas yang bersifat umum. Tanpa disadari ketika kita membangun sebuah aplikasi yang banyak melibatkan banyak fungsionalitas yang telah dibangun itu ternyata sama atau berulang-ulang. Dengan pengelempokkan itulah kita dapat mempercepat pengembangan aplikasi.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Selain kemudahan dan kecepatan dalam membangun sistem, dengan menggunakan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;tertentu kita juga dapat \\u201cmenyeragamkan\\u201d cara kita mengimplementasikan kode program. Dengan framework kita akan \\u201cdipaksa\\u201d untuk patuh kepada sebuah kesepakatan. Selain itu juga akan memudahkan pengembang lain untuk mempelajari dan mengubah aplikasi yang telah dibuat apabila kode yang dihasilkan konsisten dan patuh pada sebuah aturan tertentu.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/p><h2 style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 5px; font-size: 30px;\\\"><span style=\\\"outline: 0px;\\\">Apa itu Codeigniter?<\\/span><\\/h2><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">CodeIgniter adalah sebuah web application framework yang bersifat open source digunakan untuk membangun aplikasi php dinamis. Tujuan utama pengembangan Codeigniter adalah untuk membantu developer untuk mengerjakan aplikasi lebih cepat daripada menulis semua code dari awal. Codeigniter menyediakan berbagai macam library yang dapat mempermudah dalam pengembangan. CodeIgniter diperkenalkan kepada publik pada tanggal 28 februari 2006.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">CodeIgniter sendiri dibangun menggunakan konsep Model-View-Controller development pattern. CodeIgniter sendiri merupakan salah satu framwoerk tercepat dibandingkan dengan framework lainnya. Pada acara frOSCon (August 2008), pembuat php Rasmus Lerdorf mengatakan dia menyukai codeigniter karena dia lebih ringan dan cepat dibandingkan framework lainnya ( \\\"because it is faster, lighter and the least like aframework.\\\")<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Apa sih Kelebihan CodeIgniter?<\\/span><\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/span><\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">CodeIgniter sangat ringan, terstruktur, mudah dipelajari, dokumentasi lengkap dan dukungan yang luar biasa dari forum CodeIgniter. Selain itu CodeIgniter juga memiliki fitur-fitur lainya yang sangat bermanfaat, antara lain:<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">Menggunakan Pattern MVC.<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Dengan menggunakan pattern MVC ini, struktur kode yang dihasilkan menjadi lebih terstruktur dan memiliki standar yang jelas.<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">URL Friendly.<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">URL yang dihasilkan sangat url friendly. Pada CodeIgniter diminimalisasi penggunaan $_GET dan di gantikan dengan URI.<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">Kemudahan.<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Kemudahan dalam mempelajari, membuat library dan helper, memodifikasi serta meng-integrasikan Library dan helper. Jika kita membandingkan antara CodeIgniter dengan framework-framework lainnya maka beberapa poin yang membuat CodeIgniter unggul adalah:<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kecepatan.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Berdasarkan hasil benchmark CodeIgniter merupakansalah satu framework PHP tercepat yang ada saat ini.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mudah dimodifikasi dan beradaptasi.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Sangat mudah memodifikasi behavior framework ini. Tidak membutuhkan<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Server requirement yang macam-macam serta mudah mengadopsi library lainya.<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">Dokumentasi lengkap dan jelas.<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Bahkan tanpa e-book ini pun CodeIgniter sebenarnya telah menyediakan sebuah panduan yang lengkap mengenai CodeIgniter. Semua informasi yang anda butuhkan tentang codeigniter ada disana.<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">Learning Curve Rendah.<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">CodeIgniter sangat mudah dipelajari. Dalam pemilihan&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;hal ini sangat penting diperhatikan karena kita juga harus memperhatikan skill dari seluruh anggota team. Jika sebuah&nbsp;<em style=\\\"outline: 0px;\\\">framework<\\/em>&nbsp;sangat sulit dipelajari maka akan berisiko untuk memperlambat team development anda.<\\/p><ul style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px;\\\">CodeIgniter 2.1.4<\\/li><\\/ul><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">CodeIgniter versi 2.1.4 baru saja diluncurkan. Pada versi terbaru ini, terdapat &nbsp;banyak perubahan mendasar dari CodeIgniter daripada versi sebelumnya. Perubahan ini menjadikan CodeIgniter jauh lebih kaya dan matang dibandingkan framework lainnya. Perubahan itu diantaranya adalah:<\\/p><ol style=\\\"outline: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\"><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Menghilangkan dukungan terhadap PHP4<\\/span>. PHP4 sudah tidak didukung oleh tim pengembang PHP, karena memberikan dukungan untuk PHP4 membuat CodeIgniter semakin ketinggalan dari segi fitur.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Menghilangkan fitur pluggin<\\/span>. Pluggin mirip dengan helper, bertujuan untuk menghilangkan kerancuan ini maka fitur ini dihilangkan pada CodeIgniter 2.1.4.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Menghilangkan fitur&nbsp;<em style=\\\"outline: 0px;\\\">scaffolding<\\/em><\\/span>. Fitur ini nyaris tidak pernah digunakan dan implementasinya masih kurang bagus.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Penambahan&nbsp;<em style=\\\"outline: 0px;\\\">library driver<\\/em><\\/span>. Ini adalah&nbsp;<em style=\\\"outline: 0px;\\\">library<\\/em>&nbsp;khusus dimana kita dapat membuat&nbsp;<em style=\\\"outline: 0px;\\\">driver<\\/em>&nbsp;dari&nbsp;<em style=\\\"outline: 0px;\\\">library<\\/em>&nbsp;yang telah kita buat.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\"><em style=\\\"outline: 0px;\\\">Support query string<\\/em><\\/span><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">&nbsp;dan&nbsp;<em style=\\\"outline: 0px;\\\">command-line execution<\\/em><\\/span>. Hal ini menjawab kesulitan-kesullitan yang dialami pada versi sebelumnya.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Penambahan library cache<\\/span>. &nbsp;Untuk meningkatkan kualitas aplikasi maka library cache baik &nbsp;menggunakan apc, memcached maupun file base.<\\/li><li style=\\\"outline: 0px; margin-bottom: 20px;\\\"><span style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif;\\\">Penambahan fitur package<\\/span>. Untuk mempermudah distribusi&nbsp;<em style=\\\"outline: 0px;\\\">resource<\\/em>&nbsp;dalam sebuah folder.<\\/li><\\/ol><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/p><h2 style=\\\"outline: 0px; font-family: OpenSansBold, Helvetica, Arial, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 5px; font-size: 30px;\\\"><span style=\\\"outline: 0px;\\\">Apa itu MVC?<\\/span><\\/h2><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">&nbsp;<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">MVC adalah konsep dasar yang harus diketahui sebelum mengenal CodeIgniter . MVC adalah singkatan dari&nbsp;<em style=\\\"outline: 0px;\\\">Model View Controller<\\/em>. MVC sebenarnya adalah sebuah pattern\\/teknik pemogramanan yang memisahkan bisnis logic (alur pikir), data logic (penyimpanan data) dan presentation logic (antarmuka aplikasi) atau secara sederhana adalah memisahkan antara desain, data dan proses. Adapun komponen-komponen MVC antara lain:<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">1. Model<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Model berhubungan dengan data dan interaksi ke database atau webservice. Model juga merepresentasikan struktur data dari aplikasi yang bisa berupa basis data maupun data lain, misalnya dalam bentuk file teks, file XML maupun webservice. Biasanya di dalam model akan &nbsp;berisi class dan fungsi untuk mengambil, melakukan update dan menghapus data website. &nbsp;Sebuah aplikasi web biasanya menggunakan basis data dalam menyimpan data, maka pada bagian Model biasanya akan berhubungan dengan perintah-perintah query SQL.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">2. View<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">View berhubungan dengan segala sesuatu yang akan ditampilkan ke end-user. Bisa berupa &nbsp;halaman web, rss, javascript dan lain-lain. Kita harus menghindari adanya logika atau pemrosesan data di view. Di dalam view hanya berisi variabel-variabel yang berisi data yang siap ditampilkan. View dapat dikatakan sebagai halaman website yang dibuat dengan menggunakan HTML dan bantuan CSS atau JavaScript. Di dalam view jangan pernah ada kode untuk melakukan koneksi ke basisdata. View hanya dikhususkan untuk menampilkan data-data hasil dari model dan controller.<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">3. Controller<\\/p><p style=\\\"outline: 0px; margin: 20px 0px; line-height: 1.5; overflow-wrap: break-word; color: rgb(51, 51, 51); font-family: OpenSansRegular, Helvetica, Arial, sans-serif;\\\">Controller bertindak sebagai penghubung data dan view. Di dalam Controller inilah &nbsp;terdapat class-class dan fungsi-fungsi yang memproses permintaan dari View ke dalam struktur data di dalam Model. Controller juga tidak boleh berisi kode untuk mengakses basis data karena tugas mengakses data telah diserahkan kepada model. Tugas controller adalah menyediakan berbagai variabel yang akan ditampilkan di view, memanggil model untuk melakukan akses ke basis data, menyediakan penanganan kesalahan\\/error, mengerjakan proses logika dari aplikasi serta melakukan validasi atau cek terhadap input.<\\/p>\"}', '::1', 'Chrome', 'Windows 10 - SYSTEM', '2020-05-12 22:46:27'),
